    "This application enables seamless integration with open source project management and collaboration software OpenProject.\n\nOn the Nextcloud end, it allows users to:\n\n* Link files and folders with work packages in OpenProject\n* Find all work packages linked to a file or a folder\n* Create work packages directly in Nextcloud\n* View OpenProject notifications via the dashboard\n* Search for work packages using Nextcloud's search bar\n* Link work packages in rich text fields via Smart Picker\n* Preview links to work packages in text fields\n* Link multiple files and folder to a work package at once\n\nOn the OpenProject end, users are able to:\n\n* Link work packages with files and folders in Nextcloud\n* Upload and download files directly to Nextcloud from within a work package\n* Open linked files in Nextcloud to edit them\n* Let OpenProject create shared folders per project\n\nFor more information on how to set up and use the OpenProject application, please refer to [integration setup guide](https://www.openproject.org/docs/system-admin-guide/integrations/nextcloud/) for administrators and [the user guide](https://www.openproject.org/docs/user-guide/nextcloud-integration/)." : "ແອັບພລິເຄຊັນນີ້ຊ່ວຍໃຫ້ສາມາດເຊື່ອມໂຍງກັບ OpenProject ໄດ້ຢ່າງລຽບງ່າຍ, ເຊິ່ງເປັນຊັອບແວໂອເພນຊອດສຳລັບການບໍລິຫານໂຄງການ ແລະ ການຮ່ວມມື.\n\nໃນ Nextcloud, ຜູ້ໃຊ້ສາມາດ:\n\n* ເຊື່ອມໂຍງໄຟລ໌ ແລະ ໂຟນເດີກັບແພັກເກດງານໃນ OpenProject\n* ຊອກຫາແພັກເກດງານທັງໝົດທີ່ເຊື່ອມໂຍງກັບໄຟລ໌ ຫຼື ໂຟນເດີ\n* ສ້າງແພັກເກດງານໄດ້ໂດຍກົງໃນ Nextcloud\n* ເບິ່ງການແຈ້ງເຕືອນຂອງ OpenProject ຜ່ານກະດານຄວບຄຸມ (dashboard)\n* ຄົ້ນຫາແພັກເກດງານໂດຍໃຊ້ແຖບຄົ້ນຫາຂອງ Nextcloud\n* ເຊື່ອມໂຍງແພັກເກດງານໃນຊ່ອງຂໍ້ຄວາມແບບ rich text ຜ່ານ Smart Picker\n* ເບິ່ງຕົວຢ່າງລິ້ງຂອງແພັກເກດງານໃນຊ່ອງຂໍ້ຄວາມ\n* ເຊື່ອມໂຍງຫຼາຍໄຟລ໌ ແລະ ໂຟນເດີໃສ່ແພັກເກດງານພ້ອມກັນ\n\nໃນ OpenProject, ຜູ້ໃຊ້ສາມາດ:\n\n* ເຊື່ອມໂຍງແພັກເກດງານກັບໄຟລ໌ ແລະ ໂຟນເດີໃນ Nextcloud\n* ອັບໂຫຼດ ແລະ ດາວໂຫຼດໄຟລ໌ໄປຍັງ Nextcloud ໂດຍກົງຈາກພາຍໃນແພັກເກດງານ\n* ເປີດໄຟລ໌ທີ່ເຊື່ອມໂຍງຢູ່ໃນ Nextcloud ເພື່ອແກ້ໄຂ\n* ໃຫ້ OpenProject ສ້າງໂຟນເດີທີ່ແບ່ງປັນ (shared folders) ຕາມແຕ່ລະໂຄງການ\n\nສຳລັບຂໍ້ມູນເພີ່ມເຕີມກ່ຽວກັບວິທີການຕິດຕັ້ງ ແລະ ໃຊ້ງານແອັບພລິເຄຊັນ OpenProject, ກະລຸນາເບິ່ງ [ຄູ່ມືການຕິດຕັ້ງການເຊື່ອມໂຍງ](https://www.openproject.org/docs/system-admin-guide/integrations/nextcloud/) ສຳລັບຜູ້ເບິ່ງແຍງລະບົບ ແລະ [ຄູ່ມືຜູ້ໃຊ້](https://www.openproject.org/docs/user-guide/nextcloud-integration/).",
    "Keep current setup" : "ຮັກສາການຕັ້ງຄ່າປັດຈຸບັນໄວ້",
